class Login extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      email: '',
      password: '',
    };
  }

  render() {
    const { email, password } = this.state;
    return (
      <div>
        <div>
          <input
            type="text"
            name="email"
            onChange={ ({ target: { name, value } }) => this.setState({ [name]: value }) }
            placeholder="email"
          />
        </div>
      </div>
    );
  }
}

export default Login;
